using System;
using System.Collections.Generic;
using System.Linq;
using System.Net;
using System.Text;
using System.Threading.Tasks;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using Models;
using Models.Entities;
using Models.Operations;

namespace Tests.Operations
{
    [TestClass]
    public class TempFileOperationsTest : BaseTest
    {
        private TempFileOperations _tempFileOperations;

        public TempFileOperationsTest()
        {
            _tempFileOperations = new TempFileOperations(_context);
        }

        [TestMethod]
        public void Get_Ok_Test()
        {
            var tempFile = _context.TempFiles.First();
            var result = _tempFileOperations.GetAsync(tempFile.Id).Result;
            Assert.AreEqual(tempFile.Id, result.Id);
        }

        [TestMethod]
        public void Get_WrongId_Test()
        {
            var result = _tempFileOperations.GetAsync(99999).Result;
            Assert.IsNull(result);
        }

        [TestMethod]
        public void Update_Ok_Test()
        {
            var tempFile = _context.TempFiles.First();
            var rndString = Guid.NewGuid().ToString();
            var result = _tempFileOperations.UpdateAsync(new TempFile
            {
                Id = tempFile.Id,
                Data = Convert.FromBase64String(""),
                Filename = rndString + ".jpg",
                FormId = rndString,
            }).Result;

            Assert.AreEqual(rndString+".jpg", result.Filename);
            Assert.AreEqual(rndString, result.FormId);
        }

        [TestMethod]
        public void Add_Ok_Test()
        {
            var rndString = Guid.NewGuid().ToString();
            var result = _tempFileOperations.AddAsync(new TempFile
            {
                Data = Convert.FromBase64String(""),
                Filename = rndString + ".jpg",
                FormId = rndString,
            }).Result;
            Assert.AreEqual(rndString, result.FormId);
            Assert.IsTrue(result.Id!=0);
        }

        [TestMethod]
        [ExpectedException(typeof(FormatException))]
        public void Add_WrongData_Test()
        {
            var rndString = Guid.NewGuid().ToString();
            _tempFileOperations.AddAsync(new TempFile
            {
                Data = Convert.FromBase64String("хуй"),
                Filename = rndString + ".jpg",
                FormId = rndString,
            }).Wait();
        }

        [TestMethod]
        [ExpectedException(typeof(AggregateException))]
        public void Add_WrongFilename_Test()
        {
            var rndString = Guid.NewGuid().ToString();
            _tempFileOperations.AddAsync(new TempFile
            {
                Data = Convert.FromBase64String(""),
                Filename = null,
                FormId = rndString,
            }).Wait();
        }

        [TestMethod]
        public void Delete_Ok_Test()
        {
            var tempFile = _context.TempFiles.First();
            _tempFileOperations.DeleteAsync(tempFile.Id).Wait();

            using (var cntxt = new HobbyContext())
            {
                Assert.IsNull(cntxt.TempFiles.FirstOrDefault(tf => tf.Id == tempFile.Id));
            }
        }

        [TestMethod]
        [ExpectedException(typeof(AggregateException))]
        public void Delete_WrongId_Test()
        {
            _tempFileOperations.DeleteAsync(999999).Wait();
        }

        [TestMethod]
        public void GetByFormId_Ok_Test()
        {
            var formId = _context.TempFiles.First(tf => tf.FormId != null).FormId;
            var result = _tempFileOperations.GetByFormIdAsync(formId).Result;
            Assert.IsTrue(result.Any());
        }

        [TestMethod]
        public void GetByFormId_WrongFormId_Test()
        {
            var result = _tempFileOperations.GetByFormIdAsync("piska").Result;
            Assert.IsFalse(result.Any());
        }

        [TestMethod]
        public void RemoveAllByFormId_Ok_Test()
        {
            var formId = _context.TempFiles.First(tf => tf.FormId != null).FormId;
            _tempFileOperations.RemoveAllByFormIdAsync(formId).Wait();

            using (var cntx = new HobbyContext())
            {
                Assert.IsFalse(cntx.TempFiles.Any(tf => tf.FormId == formId));
            }
        }

        [TestMethod]
        public void RemoveAllByFormId_WrongFormId_Test()
        {
            _tempFileOperations.RemoveAllByFormIdAsync("hooy").Wait();
        }

    }
}
